import React, { useState } from 'react';
//import { Route } from 'react-router';
import GoogleLogin from 'react-google-login';

const Login = () => {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [allEntry, setAllEntry] = useState([]);

    const SubmitForm = (e) => {
        e.preventDefault();

        const newEntry = { email, password };
        setAllEntry([...allEntry, newEntry]);
        console.log(allEntry);
        setEmail("");
        setPassword("");

    }

    const responseGoogle = (response) => {
        console.log(response);
    }

    return (
        <>
            <div clasName="container-fluid nav_bg">
                <div className="row">
                    <div className="col-10 mx-auto">

                        <form action="" onSubmit={SubmitForm}>
                            <div className="mb-3">
                                <label htmlFor="emaillebel" className="form-label">Email address</label>
                                <input type="email" className="form-control" id="email" name="email" aria-describedby="emailHelp" value={email} onChange={(e) => setEmail(e.target.value)} />
                                <div id="emailHelp" className="form-text">We'll never share your email with anyone else.</div>
                            </div>
                            <div className="mb-3">
                                <label htmlFor="passlebel" className="form-label">Password</label>
                                <input type="password" className="form-control" id="password" name="password" value={password} onChange={(e) => setPassword(e.target.value)} />
                                <a href="#">Forget your password?</a>
                            </div>




                            <button type="submit" className="btn btn-primary">Submit</button>
                        </form>




                    </div>
                </div>

                <div className="row mt-3 ">
                    <div className="col-10 mx-auto">

                        <div className="mb-3">
                            <div className="line"></div>
                            <div className="text">------------or</div>

                            <GoogleLogin
                                clientId="658977310896-knrl3gka66fldh83dao2rhgbblmd4un9.apps.googleusercontent.com"
                                buttonText="Login"
                                onSuccess={responseGoogle}
                                onFailure={responseGoogle}
                                cookiePolicy={'single_host_origin'}
                            />

                        </div>

                    </div>

                </div>
            </div>
        </>
    );
};

export default Login;
